#include <stdio.h>
#include <stdlib.h>

int main() {
    int n, m;
    scanf("%d", &n);
    int* d = (int*)malloc(n * sizeof(int));
    for (int i = 0; i < n; i++) {
        scanf("%d", &d[i]);
    }
    scanf("%d", &m);
    int* t = (int*)malloc(m * sizeof(int));
    for (int i = 0; i < m; i++) {
        scanf("%d", &t[i]);
    }

    int* count = (int*)malloc(1000001 * sizeof(int));
    for (int i = 0; i < 1000001; i++) {
        count[i] = 0;
    }

    for (int i = 0; i < n; i++) {
        count[d[i]]++;
    }

    int i = 0;
    while (i < m) {
        int j = 0;
        while (j < n && d[j] < t[i]) {
            j++;
        }
        if (j == n) {
            printf("NO\n");
            return 0;
        }
        if (count[t[i]] > 0) {
            count[t[i]]--;
        } else {
            count[d[j]]--;
            d[j] = t[i];
            count[d[j]]++;
        }
        i++;
    }

    printf("YES\n");
    return 0;
}
